public synchronized void remove(String serialPart, String timeStampPart) {
  if (cache.containsKey(serialPart)) {
    Set<String> set = cache.get(serialPart);
    set.remove(timeStampPart);
    if (set.isEmpty()) {
      cache.remove(serialPart);
    }
  }
}
